// Footer.js
import './footer.css';
import React from 'react';
import background from '../pic/background.png'

const Footer = () => {
  return (
    <footer>
      <div>
        <p>This is the footer.</p>
        <img  src={background} className='background' alt="background image"/>
      </div>
    </footer>
  );
};

export default Footer;
